CREATE TABLE `reg_table` (
  `name` varchar(20) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `gender` char(1) DEFAULT NULL,
  `username` varchar(10) NOT NULL DEFAULT '',
